import I18n from "@/layouts/components/navbar/components/I18n.vue"; //import NotificationDropDown from "@/layouts/components/navbar/components/NotificationDropDown.vue"

import Profile from "./components/Profile";
import Logo from "./Logo";
export default {
  name: "the-navbar-horizontal",
  props: {
    logo: {
      type: String
    },
    navbarType: {
      type: String,
      required: true
    }
  },
  components: {
    Logo: Logo,
    I18n: I18n,
    //NotificationDropDown,
    Profile: Profile
  },
  computed: {
    navbarColor: function navbarColor() {
      var color = "#fff";
      if (this.navbarType === "sticky") color = "#f7f7f7";else if (this.navbarType === 'static') {
        if (this.scrollY < 50) {
          color = "#f7f7f7";
        }
      }
      this.isThemedark === "dark" ? color === "#fff" ? color = "#02142b" : color = "#111" : null;
      return color;
    },
    isThemedark: function isThemedark() {
      return this.$store.state.theme;
    },
    navbarStyle: function navbarStyle() {
      return this.navbarType === "static" ? {
        transition: "all .25s ease-in-out"
      } : {};
    },
    navbarClasses: function navbarClasses() {
      return this.scrollY > 5 && this.navbarType === "static" ? null : "d-theme-dark-light-bg shadow-none";
    },
    scrollY: function scrollY() {
      return this.$store.state.scrollY;
    },
    verticalNavMenuWidth: function verticalNavMenuWidth() {
      return this.$store.state.verticalNavMenuWidth;
    },
    windowWidth: function windowWidth() {
      return this.$store.state.windowWidth;
    }
  }
};
